import * as React from 'react';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import  FormControl  from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';

import { makeStyles } from '@material-ui/core/styles'


const useStyles = makeStyles(theme => ({
  marginAutoContainer: {
    width: 500,
    height: 80,
    display: 'flex',
    backgroundColor: 'gold',
  },
  marginAutoItem: {
    margin: 'auto'
  },
  alignItemsAndJustifyContent: {
    width: 500,
    height: 80,
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'pink',
  },
}))


export default function RowRadioButtonsGroup() {
      const classes = useStyles()

  return (
    <FormControl component="fieldset">
      <FormLabel component="legend"></FormLabel>
      <RadioGroup row aria-label="agrupamento" name="agrupamento"  className={classes.alignItemsAndJustifyContent}>
        <FormControlLabel value="descricao" control={<Radio />} label="Descrição" />
        <FormControlLabel value="unidade" control={<Radio />} label="Unidade de Medida" />
        <FormControlLabel value="ano" control={<Radio />} label="Ano" />
        <FormControlLabel value="item" control={<Radio />} label="Grupo do Item" />

      </RadioGroup>
    </FormControl>
  );
}
